import React, { useState, useEffect } from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import HelpIcon from '@mui/icons-material/Help';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import BW_Robotics from '../images/BW_Robotics_LOGO.jpg';

export default function ButtonAppBar() {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = useCallback(
    () => {
      setOpen(true);
    },
    [a, b],
  );

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
            onClick={handleClickOpen}
          >
            <HelpIcon />
          </IconButton>
          <Typography variant="h6" 
                      align="center" 
                      component="div" 
                      sx={{ flexGrow: 1, fontWeight: 'bold' }}>
            Vehicles: O'coffee Brazil
          </Typography>
          <img
            src={BW_Robotics}
            height='30'
            alt="BW_Robotics"
            loading="lazy"
         />
        </Toolbar>
        <Dialog
          open={open}
          keepMounted
          onClose={handleClose}
          aria-describedby="alert-dialog-slide-description"
        >
          <DialogTitle>Welcome to Blue White Robotics</DialogTitle>
          <DialogContent>
            <DialogContentText id="alert-dialog-slide-description">
              In the map you can find drones and tractors live from the field.
              Move over each of them and you can see an interesting data.
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <Button onClick={handleClose}>Close</Button>
          </DialogActions>
        </Dialog>
      </AppBar>
    </Box>
  );
}
